window.bookSummaryJSON = "<p>A Netflix original movie starring Millie Bobby Brown, Henry Cavill, and Helena Bonham Carter!</p> <p>Meet Enola Holmes, teenaged girl turned detective and the younger sister to Sherlock Holmes. When Enola Holmes, sister to the detective Sherlock Holmes, discovers her mother has disappeared, she quickly embarks on a journey to London in search of her. </p> <p>But nothing can prepare her for what awaits. Because when she arrives, she finds herself involved in the kidnapping of a young marquess, fleeing murderous villains, and trying to elude her shrewd older brothers—all while attempting to piece together clues to her mother’s strange disappearance. </p> <p>Amid all the mayhem, will Enola be able to decode the necessary clues and find her mother?</p>"; 
